/** @jsxImportSource @emotion/react */
import { css } from "@emotion/react";
import { VFlow } from "bold-ui";
import React, { Fragment } from "react";

interface TitleHeaderProps {
  title: string;
}

export function TitleHeader(props: TitleHeaderProps) {
  const { title } = props;

  return (
    <Fragment>
      <VFlow vSpacing={3}>
        <h1 css={titleHeaderStyles}>{title}</h1>
        <div css={lineStyles}></div>
      </VFlow>
    </Fragment>
  );
}

const titleHeaderStyles = css`
  text-align: center;
  width: 100%;
  margin: 0 auto;
`;

const lineStyles = css`
  width: 30%;
  height: 4px;
  background-color: #0069d0;
  border-bottom: 1px solid #0069d0;
  border-radius: 5px;
  margin: 0 auto;
`;
